def iqtree(path_in, genes, path_out):
    """Using IQTREE to find the best model with ModelFinder"""
    inputs = [path_in+genes]
    outputs = [path_out+genes+".treefile"]
    options = {'cores': 2, 'memory': "40g", 'walltime': "24:00:00", 'account':"dypsidinae"}

    spec = """
     
   
        
    #Activate the enviroment
    source /home/kris/miniconda3/etc/profile.d/conda.sh
    conda activate iqtree

    iqtree2 -s {path_in}{genes} -T AUTO -m TESTONLY -mset mrbayes  

    cd {path_in}

    mv {genes}.treefile {path_out}
    mv {genes}.ckp.gz {path_out}
    mv {genes}.iqtree {path_out}
    mv {genes}.model.gz {path_out}
    mv {genes}.log {path_out}

    """.format(path_in = path_in, genes = genes, path_out=path_out)

    return (inputs, outputs, options, spec) 
 
