def no_X(path_in, genes):
    """Using AMAS to convert files"""
    inputs = [path_in+genes+"-out.nex"]
    outputs = [path_in+genes+"_no_X-out.nex"]
    options = {'cores': 2, 'memory': "10g", 'walltime': "2:00:00", 'account':"dypsidinae"}

    spec = """
     
    cd {path_in}
    sed '7,$s/X/N/g' <{genes}-out.nex > {genes}_no_X-out.nex 
      

    """.format(path_in = path_in, genes = genes)

    return (inputs, outputs, options, spec) 

